import React, { Component } from 'react'
import styled from 'styled-components'
import img from "./oi.jpg";
import img2 from "./opa.jpg";
import Image from '../components/Image/index'

const DivText = styled.div`
  background-color: #f1f1f1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 100%;
  padding:40px 0;
`;
const DivImage = styled.div`
  background-image: url(${props => props.image});
  box-shadow: 0px 100vh rgba(0, 0, 0, ${props => props.x} ) inset;
  position: relative;
  height: ${props => props.height};
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  display: flex;
  flex-direction: column;
  align-items: ${props => props.align};
  justify-content: ${props => props.justify};
  width: 100%;
  filter:  contrast(${props => props.contrast});
  filter: brightness(${props => props.brightness});
`;
class About extends Component {
  render() {
    return (
      <div>
       <Image title='ABOUT US' height="100vh" image={img}/>
        <DivText></DivText>
        <DivImage x='0.35' height="100vh" image={img2} brightness="120%" contrast="140%" align='center' justify='center'></DivImage>
      </div>
    )
  }
}
export default About
